<div class="textwrapper"><textarea placeholder="Write a comment..." oninput="this.innerHTML = this.value;pybridge._add_comment(this.parentNode.parentNode.id, this.value);">In the book_excerpts dataset there are books written for children and adults.We are trying to categorise them accordingly.There are 3 clusters that can be analysed here.All the books with only content for children are in two clusters C1,C3 and cluster C2 contains content directed to adults and children. But C1 and C3 are not a single cluster. This could be that the content in them maynot be similar but intended for children. Also cluster C2 has a mix of adult and children in it. this can mean that the content in them may contain data for children as well as adults.</textarea></div></div></body></html>
